import React from 'react'
import { Navbar } from 'reactstrap'

export default function Acceuil() {
    return (
        <div>
            <Navbar/>
            <div>
            <Link to='/search/expertsList'><button className="homeButton">Chercher expert</button></Link>
            </div>
        </div>
    )
}
